        }
        if 0x3134b <= x && x < 0x31350 {
            return false;
        }
        if 0x3347a <= x && x < 0xe0100 {
            return false;
        }
        if 0xe01f0 <= x && x < 0x110000 {
            return false;
        }
        true
    }
}

